        type='plain'>Descargar canción:  http://www.sendspace.com/file/a5sjsz\n\n\nLetra:\n\n\"Para
        todos los que están, para todos los que se han ido,\npara cada fan y por cada
        sueño cumplido.\nBrindo por cada uno de vosotros con los míos\nno importa
        la edad, seas adulto o solo un crío.\nAparta los problemas estos días,\nson
        para que los pases con aquel en quién confías.\nOlvida tus penas saca a flote
        tu alegría\nCreas o no creas, lo que importa es la familia,\nno lo material,
        lo real eres tú.\nLa ilusión,el fiestón el festín, la salud.\nSe acaba el
        2012 y lo despido con esta \nes mi forma para desearos a todos felices fiestas.\n\nNo
        hubo fin del mundo, estamos en 2013,\nle deseo a todos aquello que se merecen.\nAmanece
        un día más y mi rap crece,\nyo sigo siendo un crío aunque mi cuerpo envejece.\nLe
        pese a quién le pese aveces se pasa mal,\npero los guerreros no se rinden
        jamás sin luchar.\nEste año va a ser de los mejores,\nesto va por cada portadora
        y por todos los portadores.\"</media:description><media:keywords/><media:license
